import React from 'react';

function YtScreen() {
  return (
    <div>
      <iframe 
        width="560" 
        height="315" 
        src="https://www.youtube.com/watch?v=j_6dqzDvxNY&ab_channel=PlayStationEurope" 
        title="YouTube video player" 
        frameborder="0" 
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
        allowfullscreen>
      </iframe>
    </div>
  );
}

export default YtScreen;
